    >
      <div className="container">
        <div className="row">
          <div className="col-md-8">
            <div className="d-flex flex-row justify-content-between align-items-start "
            style={{
              gap: "120px"
            }}>
             <VPHomes/>
              <Company/>
         <ContactUs/>
         </div>
         </div>
        </div>
      </div>
    </footer>
  );
};

